class ShippingData {  ShippingData({    this.email,    this.firstName,    this.lastName,    this.phoneNumber,    this.extraDescription,    this.country,  });  ShippingData.fromJson(dynamic json) {    email = json['email'];    firstName = json['first_name'];    lastName = json['last_name'];    phoneNumber = json['phone_number'];    extraDescription = json['extra_description'];    country = json['country'];  }  String ?email;  String ?firstName;  String ?lastName;  String ?phoneNumber;  String ?extraDescription;  String ?country;  Map<String, dynamic> toJson() {    final map = <String, dynamic>{};    map['email'] = email;    map['first_name'] = firstName;    map['last_name'] = lastName;    map['phone_number'] = phoneNumber;    map['extra_description'] = extraDescription;    map['country'] = country;    return map;  }}